import React from "react";

import StickyFooter from 'react-sticky-footer';

const Footer = () => {
  return (
    <StickyFooter
    bottomThreshold={50}
    normalStyles={{
    backgroundColor: "#999999",
    padding: "2rem"
    }}
    stickyStyles={{
    backgroundColor: "rgba(255,255,255,.8)",
    padding: "2rem"
    }}

    >
    <div className="row">
    <div className="col-md-4">
    <h3>Cell: 843-271-3434</h3>
    </div>
    <div className="col-md-4">
    <h3>Email:</h3>
    </div>
    </div>
</StickyFooter>
  );
}

export default Footer;
